import { Carousel, Image } from 'antd';
import React from 'react';

function Home() {

  const carouselBS: React.CSSProperties = {
    position: 'relative',
  };

  const carouselS: React.CSSProperties = {
    
  };

  const carouselCS: React.CSSProperties = {
    top: 0,
    left: 0,
    position: 'absolute',
  };

  const carouselConfig = {
    autoplay: true,
  };

  return (<>
    <div className='container-fluid' style={carouselBS}>
      <Carousel className='w-100 h-100' style={carouselS} {...carouselConfig}>
        <div className='w-100' >
          <img className='w-100' src='/images/carousel-1.jpg' />
        </div>
        <div>

        </div>
      </Carousel>
      <div className='w-100 h-100' style={carouselCS}>
        <h1>Home</h1>
      </div>
    </div>
  </>);
}
export default Home;
